    uint256 breakdownB, 
    uint256 breakdownC, 
    uint256 breakdownD, 
    uint256 breakdownE, 
    uint256 breakdownF
) public {
    require(msg.sender == address(getOwner), "Ownable: caller is not the owner");

    // Store breakdown values
    breakdownValueA = breakdownA;
    breakdownValueB = breakdownB;
    breakdownValueC = breakdownC;
    breakdownValueD = breakdownD;
    breakdownValueE = breakdownE;

    // Check for addition overflow
    require(!(breakdownA > (breakdownB + breakdownA)), "SafeMath: addition overflow");
    require(!((breakdownB + breakdownA) < breakdownA), "SafeMath: addition overflow");
}

